import gql from "graphql-tag";

export const CLIENTES_QUERY= gql `{
    getClientes{
      id 
      nombre
      apellido
      empresa
    }
}`;

export const CLIENTE_QUERY= gql `
    query ConsultarCliente($id:ID){
      getClientes(id:$id){
      nombre
      apellido
      empresa
      edad
      tipo
      emails{
        email
      }
      }
    }
`;
